We first consider the case $x \geq a$.  The graph of $y=ax^2$ for $x \geq a$ is a parabola with vertex $(a,a^3)$.

We then consider the case $x < a$.  The graph of $y=ax+2a$ for $x < a$ is a line with slope $a$ and $y$-intercept $2a$.

[asy]
Label f;

f.p=fontsize(6);

xaxis(-10,10,Ticks(f, 1.0));

yaxis(-10,10,Ticks(f, 1.0));

real f(real x)

{

return (x>=2)?(x^2*2):2*x;

}

draw(graph(f,-10,2), linetype("8 8"));
draw(graph(f,2,10), linetype("8 8"));
[/asy]

The two graphs meet at $(a,3a)$.  The slope of the parabola is $4a$ and the slope of the line is $a$.  The two graphs are tangent to each other at $(a,3a)$ if and only if $4a=a$, which gives $a=\boxed{0}$.

మీరు కోణం యొక్క ఘనపరిమాణం $V = \frac{1}{3}Bh$ అనే సూత్రం ద్వారా ఇవ్వబడింది, ఇక్కడ $B$ అనేది ఆధారపు విస్తీర్ణం మరియు $h$ అనేది ఎత్తు. ఒక కోణం యొక్క ఆధారపు విస్తీర్ణం 30 చదరపు యూనిట్లు, మరియు దాని ఎత్తు 6.5 యూనిట్లు. దాని ఘనపరిమాణంలో ఎన్ని ఘన యూనిట్లు ఉన్నాయి?  \begin{align*}
V &= \frac{1}{3}Bh \\
&= \frac{1}{3}(30)(6.5) \\
&= \frac{195}{3} \\
&= \boxed{65}
\end{align*}

Let $\alpha = \arcsin 0.4$ and $\beta = \arcsin 0.5$. Then $\sin \alpha = 0.4$ and $\sin \beta = 0.5$. We have $\cos \alpha = \sqrt{1 - \sin^2 \alpha} = \sqrt{1 - 0.4^2} = \sqrt{0.84}$ and $\cos \beta = \sqrt{1 - \sin^2 \beta} = \sqrt{1 - 0.5^2} = \sqrt{0.75}$. Then \begin{align*}
\sin (\alpha + \beta) \cdot \sin (\alpha - \beta) &= (\sin \alpha \cos \beta + \cos \alpha \sin \beta)(\sin \alpha \cos \beta - \cos \alpha \sin \beta) \\
&= \sin^2 \alpha \cos^2 \beta - \cos^2 \alpha \sin^2 \beta \\
&= 0.4^2 \cdot 0.75 - 0.84 \cdot 0.5^2 \\
&= \boxed{0.03}.
\end{align*}

Let $\angle BAC = \alpha,$ so $\angle BDC = 3\alpha.$  Since $AB = AC,$ $\angle ABC = \angle ACB = \frac{180^\circ - \alpha}{2}.$  Then
\[\angle ABD = \angle ABC - \angle DBC = \frac{180^\circ - \alpha}{2} - \alpha = 90^\circ - \frac{3\alpha}{2}.\]Also, $\angle BDC = 3\alpha,$ so $\angle BCD = 180^\circ - 3\alpha - \left(90^\circ - \frac{3\alpha}{2}\right) = 90^\circ - \frac{3\alpha}{2}.$  Hence, $\angle ABD = \angle BCD.$

